Takes the value out of the option, leaving a None in its place. let mut x = Some(2);
let y = x.take();
assert_eq!(x, None);
assert_eq!(y, Some(2)); let mut x: Option<u32> = None;
let y = x.take();
assert_eq!(x, None);
assert_eq!(y, None);

5.body:
By creating a generic function that takes an AsRef<str> we express that we want to accept all references that can be converted to &str as an argument. Since both String and &str implement AsRef<str> we can accept both as input argument. fn is_hello<T: AsRef<str>>(s: T) { assert_eq!("hello", s.as_ref());
} let s = "hello";
is_hello(s); let s = "hello".to_string();
is_hello(s);

