Swaps the values at two mutable locations, without deinitializing either one. use std::mem; let mut x = 5;
let mut y = 42; mem::swap(&mut x, &mut y); assert_eq!(42, x);
assert_eq!(5, y);

9.body:
Moves src into the referenced dest, returning the previous dest value. use std::mem; let mut v: Vec<i32> = vec![1, 2]; let old_v = mem::replace(&mut v, vec![3, 4, 5]);
assert_eq!(vec![1, 2], old_v);
assert_eq!(vec![3, 4, 5], v);
